import React from'react';
import './SignUp.css';
const SignUp = () => {

    const signInButton = (e) => {
        e.preventDefault();
    }

    const signUpLink = (e) => {
        e.preventDefault();
    }
    return(
        <div className='signUp'>
            <h1 className='signUp__title'>Sign In</h1>
            <form>
                <input type='email' placeholder='Email or phone number' />
                <input type='password' placeholder='Password' />
                <button type='submit' onClick={signInButton}>Sign In</button>
            </form>
            <h5><span className='signUp__new'>New to Netflix?</span> <span className='signUp__link' onClick={signUpLink}>Sign up now</span></h5>
        </div>
    )
}

export default SignUp;
